import React from 'react'
import './Menu.component.scss'
import { Link, useHistory } from 'react-router-dom'
import { motion } from "framer-motion"

const wrapperVariants = {
    visible:{
        transition: {
            when: "beforeChildren",
            staggerChildren: 0.3
        }
    }
}

const linkVariants = {
    initial: { opacity: 0, y: '20px'},
    visible: { opacity: 1, y: 0}
}

export default function Menu() {
    return (
        <motion.div className="menu" variants={wrapperVariants}>
            <Link to="/" exact>
                <motion.h3 variants={linkVariants}>Home</motion.h3>
            </Link>
            <Link to="/produse" exact>
                <motion.h3 variants={linkVariants}>Produse</motion.h3>
            </Link>
            <Link to="/info" exact>
                <motion.h3 variants={linkVariants}>Livrare</motion.h3>
            </Link>
            <Link to="/info" exact>
                <motion.h3 variants={linkVariants}>Retur</motion.h3>
            </Link>
            <Link to="/info" exact>
                <motion.h3 variants={linkVariants}>Plata</motion.h3>
            </Link>
        </motion.div>
    )
}
